import styled from "styled-components";

export const ButtonBlue = styled.button`
  color: white;
  background-color: darkblue;
  border: 1px solid blue;
  border-radius: 20px;
  font-size: 16px;
  font-weight: bold;
  padding: 10px;
  margin: 20px;
  cursor: pointer;
`;
